import React from 'react'

function SlotList() {

        const [slots, setSlots] = useState([]);

        // Fetch slots data from the API when the component mounts
        useEffect(() => {
          axios.get('http://localhost:7000/api/get_slots')
            .then(response => {
              // Check if the response contains the Slots array and set it to state
              if (response.data.success) {
                setSlots(response.data.Slots || []); // Access the Slots array
              } else {
                console.error('Failed to fetch slots');
              }
            })
            .catch(error => {
              console.error("There was an error fetching the slots:", error);
            });
        }, []);

        return (
          <div className="page-content">
            {/* start page title */}
            <div className="page-title-box">
              <div className="container-fluid">
                <div className="row align-items-center">
                  <div className="col-sm-6">
                    <div className="page-title">
                      <h4>Responsive Table</h4>
                    </div>
                  </div>
                </div>
              </div>
            </div>
            {/* end page title */}
            <div className="container-fluid">
              <div className="page-content-wrapper">
                <div className="row">
                  <div className="col-12">
                    <div className="card">
                      <div className="card-body">
                        <h4 className="header-title">Available Slots</h4>
                        <p className="card-title-desc">Below are the available slots fetched from the server.</p>
                        <div className="table-rep-plugin">
                          <div className="table-responsive mb-0" data-pattern="priority-columns">
                            <table id="tech-companies-1" className="table table-striped">
                              <thead>
                                <tr>
                                  <th>Slot ID</th>
                                  <th>Slot Name</th>
                                  <th>Start Time</th>
                                  <th>End Time</th>
                                  <th>Status</th>
                                </tr>
                              </thead>
                              <tbody>
                                {/* Map through the slots data and display each slot in a row */}
                                {slots.map((slot) => (
                                  <tr key={slot._id}>
                                    <td>{slot._id}</td>
                                    <td>{slot.qrId}</td>
                                    <td>{slot.startTime}</td>
                                    <td>{slot.endTime}</td>
                                    <td>{slot.status || "Available"}</td> {/* Default status if not present */}
                                  </tr>
                                ))}
                              </tbody>
                            </table>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        );
      }

export default SlotList
